import Player from "./Player";
import { playerDetails } from "./Players";
import 'bootstrap/dist/css/bootstrap.min.css';

function PlayerList()
{
    return (

      
        
          <div>
              playerDetails.map(myPlayer => 
            {
                  
               < Player  nom={myPlayer.nom}  imagePath={myPlayer.imagePath}  team={myPlayer.team}nationality={myPlayer.nationality} jerseyNumber={myPlayer.jerseyNumber}age={myPlayer.age}
               

               
               />

            })
          </div>
        
          
    

            

    );
}

export default PlayerList
